(1, 'f3991d1835b55fb', 'Jkus832Sdj32ksd', NULL, 0, 'ЭмиДент', 'ЭмиДент', 79111111111, '', '', 'г Уфа, ул Максима Рыльского, д 9/2', '$2y$11$YWUwMjhjZWZhNmVkNzk0YethBIDuolabPfpKMmNJ0eljqHDCy.9Lm', 'f1af281d48b3fdca5c4f7d0b01fd47d7.jpg', 200000100000, 'Уфа', '\r\n«Мы стремимся к тому, чтобы люди, которые посещают „ЭмиДент“, почувствовали на себе наше заботливое присутствие во всем:\r\n\r\n- в стоматологах высокого уровня,\r\n\r\n- в изящном и приятном дизайне наших клиник,\r\n\r\n- в уюте и удобстве наших интерьеров,\r\n\r\n- в обслуживании вежливых и приветливых администраторов.\r\n\r\nИ даже в том, что мы применяем высокотехнологичное оборудование и системы.\r\n\r\nВсё это мы сделали для Вас, уважаемые пациенты».', 0, 950000, 9999900, 500000, 100, 512300, 2, '', '2020-02-19 03:26:26', 0, 0, '56.069265 54.770681', 0, 1, 'EAJYjefwHB', 0, 1, 0, '', '', 1, 'круто', '2020-04-07 08:52:36', '2020-06-30 08:52:36', '2020-06-17 09:19:52', 0, 0, 0, 0),
(2, '62a65090d840326', 'Jkus832Sdj32ksd', NULL, 0, 'Тест', '', 79638964242, '', '', '', '$2y$11$OTk0ZGVlYWUwNjlkOTVjO.qBbWnftudZIAhjSG3z6yzQRRyIsDcTK', '', 0, 'Бесплатная версия kladr-api.ru', 'null', 0, 500000, 30000000, 0, 100, 500000, 2, '', '2020-04-26 11:58:48', 0, 0, NULL, 0, 1, 'CDHBFpiWMm', 1, 1, 0, NULL, NULL, 1, '', '2020-04-26 07:47:58', '2020-05-24 07:47:58', '2020-04-26 07:51:01', 0, 0, 0, 0),
(3, '1e621f7341695ae', 'Jkus832Sdj32ksd', NULL, 0, 'М.Видео', 'Иван', 79321312312, '', '', 'Респ Башкортостан, г Уфа, ул Рыбакова ', '$2y$11$ZmFhMWEwNjE2OWQwOGE0O.ArH0iEJ8jAjWs29WwiO0xOaS1voxQhK', 'f36df754be5063ff88a1ec80bb6b8242.jpg', 200000100000, 'Уфа', 'Розничная сеть «М.Видео» — одна из крупнейших розничных сетей по объёмам продаж электроники и бытовой техники в России. «М.Видео» осуществляет свою деятельность с 1993 года и является первой на российском рынке сетью, реализовавшей полноценный омниканальный подход к продажам — это единый ассортимент, цена и сервис как при покупке в магазинах, так и онлайн. Ритейлер предлагает своим покупателям несколько десятков тысяч наименований аудио/видео и цифровой техники, мелкой и крупной бытовой техники, медиатоваров, а также аксессуаров. Магазины «М.Видео» имеют единый формат и специальную концепцию дизайна. Помимо эффективного формата розничной торговли и ориентированной на покупателя концепции магазина, компания предлагает клиентам высококлассную сервисную поддержку под брендом «М.Сервис». Эксперты «М.Кредит» помогут быстро заполнить анкету и получить одобрение сразу от нескольких банков-партнёров.\n\n «М.Видео» +79321312312 Респ Башкортостан, г Уфа, ул Рыбакова ', 0, 0, 4000000, 10000000, 100, 0, 2, '', '2020-04-26 12:02:48', 0, 0, '56.087168 54.819751', 0, 1, NULL, 0, 1, 0, NULL, NULL, 1, '', '2020-04-26 09:02:37', '2020-05-24 09:02:37', '2009-12-31 18:00:00', 0, 0, 0, 0),
(4, '5d85edb8cf28601', 'Jkus832Sdj32ksd', NULL, 0, 'Ресторан Тесла', 'Иван', 79123654655, '', '', 'Респ Башкортостан, г Уфа, ул Максима Рыльского ', '$2y$11$Yjg2MjU0NWFiOTAwNTJmZ.EqfobWRwxxX4cgQPNSR/htVRHnd4jdW', '731d028fa5706764f2a748de24621f3d.png', 200000100000, 'Уфа', 'Ресторан Тесла — это лучшая площадка для проведения Вашего праздничного мероприятия. Просторная планировка зала, европейская кухня и профессиональная команда организаторов позволят воплотить в жизнь любые идеи.\n\n «Ресторан Тесла» +79123654655 Респ Башкортостан, г Уфа, ул Максима Рыльского ', 0, 0, 450000, 15000000, 100, 0, 2, '', '2020-04-26 12:07:09', 0, 0, '56.07134 54.768334', 0, 1, NULL, 0, 1, 0, NULL, NULL, 1, '', '2020-04-26 09:06:54', '2020-05-24 09:06:54', '2009-12-31 18:00:00', 0, 0, 0, 0),
